import express from 'express';
import routes from './src/routes/route.js';


const app = express();
const port = process.env.PORT || 3000;

app.use(express.json());
app.use(routes);


app.listen(port, () => {

    console.log(`Server started on port ${port}`);
    
});

export default app;

